import ReactDOM from "react-dom/client";
function App() {
  return (
    <>
      <div className="container">
        <label>Username :</label>
        <input type="text" name="username" placeholder="Enter the username" />
      </div>
    </>
  );
}
ReactDOM.render(<App />, document.getElementById("root"));
